import React from 'react';
import './LockerGrid.css';

interface LockerProps {
  isOccupied?: boolean;
  hasPackage?: boolean;
}

const Locker: React.FC<LockerProps> = ({ isOccupied, hasPackage }) => (
  <div className={`locker ${isOccupied ? 'occupied' : ''}`}>
    {hasPackage && (
      <span className="package">ðŸ“¦</span>
    )}
  </div>
);

const LockerGrid: React.FC = () => {
  const columns = ['4L', '3L', '2L', '1L', '', '1R', '2R', '3R', '4R', '5R'];

  return (
    <div className="locker-grid">
      <div className="column-headers">
        {columns.map((col) => (
          <div key={col} className="column-header">{col}</div>
        ))}
      </div>
      <div className="grid-container">
        {columns.map((col) => (
          <div key={col} className="column">
            {col === '' ? (
              <div className="service-section">
                <div className="service">Service</div>
                <div className="steering">Steering</div>
              </div>
            ) : (
              Array(7).fill(null).map((_, index) => (
                <Locker 
                  key={index} 
                  isOccupied={Math.random() > 0.2}
                  hasPackage={Math.random() > 0.3}
                />
              ))
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default LockerGrid;
